script: |
  super -f text -I q3432.spq | sort > q3432.out

inputs:
  - name: q3432.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) AS cor0 WHERE col0 NOT BETWEEN - col0 AND + + col2 * - 63 + - + 96;
  - name: tab0

outputs:
  - name: q3432.out
    data: |
      15	81	47
      87	21	10
      97	1	99
